import { Routes, Route, useLocation } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './pages/Home';
import PropertyList from './pages/PropertyList';
import PropertyDetail from './pages/PropertyDetail';
import PropertiesAvailable from './pages/PropertiesAvailable';
import Login from './pages/Login';
import Register from './pages/Register';
import GuestProperties from './pages/GuestProperties';
import AdminDashboard from './pages/AdminDashboard';
import PendingApprovals from './pages/PendingApprovals';
import LandlordApplicationDetail from './pages/LandlordApplicationDetail';
import LandlordDashboard from './pages/LandlordDashboard';
import ManageProperties from './pages/ManageProperties';
import AddProperty from './pages/AddProperty';
import EditProperty from './pages/EditProperty';
import PropertyProposals from './pages/PropertyProposals';
import TenantDashboard from './pages/TenantDashboard';
import SavedPosts from './pages/SavedPosts';
import Messages from './pages/Messages';
import RecentApplications from './components/RecentApplications';
import AdminRoute from './components/AdminRoute';
import LandlordRoute from './components/LandlordRoute';
import TenantRoute from './components/TenantRoute';
import PrivateRoute from './components/PrivateRoute';
import Contact from './pages/contact';


function App() {
  const location = useLocation();
  const hideNavbarFooter = location.pathname === '/login' || location.pathname === '/register';

  return (
    <AuthProvider>
      <div className="app">
        {!hideNavbarFooter && <Navbar />}
        
        <main className="main-content">
          <Routes>
            <Route path="/" element={<LandlordDashboard />} />
            <Route path="/contact" element={<Contact />} /> 
            <Route path="/properties" element={<PropertyList />} />
            <Route path="/properties/available" element={<PropertiesAvailable />} />
            <Route path="/properties/:id" element={<PropertyDetail />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
            <Route path="/guest/properties" element={<GuestProperties />} />

            <Route path="/admin/dashboard" element={
              <PrivateRoute>
                <AdminRoute>
                  <AdminDashboard />
                </AdminRoute>
              </PrivateRoute>
            } />
            <Route path="/admin/pending-approvals" element={
              <PrivateRoute>
                <AdminRoute>
                  <PendingApprovals />
                </AdminRoute>
              </PrivateRoute>
            } />
            <Route path="/admin/landlord-applications/:id" element={
              <PrivateRoute>
                <AdminRoute>
                  <LandlordApplicationDetail />
                </AdminRoute>
              </PrivateRoute>
            } />

            <Route path="/landlord/dashboard" element={
              <PrivateRoute>
                <LandlordRoute>
                  <LandlordDashboard />
                </LandlordRoute>
              </PrivateRoute>
            } />
            <Route path="/landlord/properties" element={
              <PrivateRoute>
                <LandlordRoute>
                  <ManageProperties />
                </LandlordRoute>
              </PrivateRoute>
            } />
            <Route path="/landlord/properties/new" element={
              <PrivateRoute>
                <LandlordRoute>
                  <AddProperty />
                </LandlordRoute>
              </PrivateRoute>
            } />
            <Route path="/landlord/properties/:id/edit" element={
              <PrivateRoute>
                <LandlordRoute>
                  <EditProperty />
                </LandlordRoute>
              </PrivateRoute>
            } />
            <Route path="/landlord/properties/:id/proposals" element={
              <PrivateRoute>
                <LandlordRoute>
                  <PropertyProposals />
                </LandlordRoute>
              </PrivateRoute>
            } />

            <Route path="/tenant/dashboard" element={
              <PrivateRoute>
                <TenantRoute>
                  <TenantDashboard />
                </TenantRoute>
              </PrivateRoute>
            } />
            <Route path="/saved-posts" element={
              <PrivateRoute>
                <TenantRoute>
                  <SavedPosts />
                </TenantRoute>
              </PrivateRoute>
            } />
            <Route path="/applications" element={
              <PrivateRoute>
                <TenantRoute>
                  <RecentApplications />
                </TenantRoute>
              </PrivateRoute>
            } />

            <Route path="/messages" element={
              <PrivateRoute>
                <Messages />
              </PrivateRoute>
            } />

            <Route path="*" element={<div>404 - Page Not Found</div>} />
          </Routes>
        </main>

        {!hideNavbarFooter && <Footer />}
      </div>
    </AuthProvider>
  );
}

export default App;
